package yawen;

import java.util.concurrent.TimeUnit;

public class LC1044H {
	public static void main(String[] args) {
		String s = "";
//		String s = "";
		double start = System.currentTimeMillis();
		System.out.println(LC1044H.longestDupSubstring(s));
		double end = System.currentTimeMillis();
		System.out.println(end-start);
	}
	
    public static String longestDupSubstring(String s) {
    	String ans = "";
    	int r,l=1;
    	for(int i=0;i<s.length();i++) {
    		//[i,r)
    		r = binarySearch(s,i);
    		if(r-i>ans.length()) {
    			ans = s.substring(i, r);
    		}
    		if(s.length()-i<=ans.length())
    			return ans;
    	}
    	return ans;
    }
    //
	private static int binarySearch(String s,int st) {
		int ll=st,rr=s.length();
		while(ll<rr) {
			int m = ll+(rr-ll)/2;
			String substring = s.substring(st, m);
			//
			if(s.indexOf(substring, st+1)==-1) {
				rr = m;
			}else {
				ll = m+1;
			}
		}
		return ll;
	}
}
